import React from "react";
import * as CuponServer from './Cupon/CuponServer';
const Pago = () =>{
    [cupones, setCupones] = useState([]);
    
    useEffect(() => {
        listaCupones(null);
    },[]);
    
    return(
        <>
        <div className="container">
            <div className="containerImg">

            </div>
            <div className="containerContent">
                <h1>Minecraft</h1>
                <div className="containerCosts">
                    <h3 className="header3">Precio</h3>
                    <p>$20</p>
                    <h3 className="iva">IVA</h3>
                    <p>$20</p>
                </div>
                <p>Seleccione un m√©todo de pago</p>
                <button>Tarjeta</button>
                <button>PayPal</button>
            </div>
            <div className="containerCupon">
                <div id={style.tarjeta} className="card" key={cupon.id}>
                    <img id={style.imgCard} src={cupon.imagen} className="card-image-top" alt=""/>
                    <div className="card-body" id={style.cuerpoTarjeta}>
                        <h5>{cupon.nombre}</h5>
                        <p>{cupon.descripcion}</p>
                    </div>
                </div>
            </div>
        </div>
        </>
    );
}
export default Pago;
